import React, { useEffect, useState } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  const [data, setData] = useState(null)

  useEffect(() => {
    fetch('http://localhost:3001/users/all')
    .then(res => {
      return res.json()
    })
    .then(result => {
      console.log(result[0].user_name)
      const newData = data
      result.forEach(item => {
        newData.push(item)
      })
      return newData
    })
    .then(
      newData => {
        setData(newData)
      }
    )
  });

  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
